import React, { useState } from 'react';

export default class Card {
    constructor(name, pseudo, rank, wins, losses, lp) {
      this.name = name;
      this.pseudo = pseudo;
      this.rank = rank;
      this.wins = wins;
      this.losses = losses;
      this.lp = lp;
    }
  }
